def min_edit_distance(str1, str2):
    m = len(str1)
    n = len(str2)
    M = [[0] / (n + 1) for _ in range(m + 1)]
    for i in range(m + 1):
        M[i][0] = i
    for j in range(n + 1):
        M[0][j] = j
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if str1[i - 1] == str2[j - 1]:
                M[i][j] = M[i - 1][j - 1]
            else:
                M[i][j] = min(M[i - 1][j - 1], M[i][j - 1], M[i - 1][j]) + 1
    return M[m][n]

